For operation with shared spectrum channel access, if the PUSCH occasion is provided by higher layer parameters interlaceIndexFirstPO-MsgA-PUSCH and nroflnterlacesPerMsgA-PO, the RB set for the PUSCH occasion in the active UL BWP is the same RB set as the corresponding PRACH transmission. The UE assumes that the RB set is defined as when the UE is not provided intraCellGuardBandsPerSCS for an UL carrier as described in clause 7 of [6, TS 38.214]. If a UE does not have dedicated RRC configuration, or has an initial UL BWP as an active UL BWP, or is not provided startSymbolAndLengthMsgA-PO, msgA-PUSCH-timeDomainAllocation provides a SLIV and a PUSCH mapping type for a PUSCH transmission by indicating - one of the first maxNrofUL-Allocations values from PUSCH-TimeDomainResourceAllocationList, if PUSCHTimeDomainResourceAllocationList is provided in PUSCH-ConfigCommon - one of the entries from table 6.1.2.1.1-2 or table 6.1.2.1.1-3 in [6, TS 38.214], if PUSCHTimeDomainResourceAllocationList is not provided in PUSCH-ConfigCommon
---
\begin{tabular}{l} msgA-PUSCH-TimeDomainAllocation Indicates a combination of start symbol and length and PUSCH mapping type from the TDRA table (PUSCH-TimeDomainResourceAllocationList if provided in PUSCHConfigCommon, or else the default Table 6.1.2.1.1-2 in 38.214 [19] is used if pusch-TimeDomainAllocationList is not provided in PUSCH-ConfigCommon). The parameter K2 in the table is not used for msgA PUSCH. The network configures one of msgA-PUSCH-TimeDomainAllocation and startSymbolAndLengthMisgA-PO, but not both. If the field is absent, the UE shall use the value of startSymbolAndLenghtMsgA-PO. \end{tabular} \begin{tabular}{l}
